		function $(o) { return (document.getElementById(o)); }

		function checkBrowser() {
			// Thanks to my collegue David San Le√≥n to helping me checking browser compatibility:
			try {
				$("mainCanvas").getContext("2d");
				$("mainCanvas").toDataURL();
